import React from "react";

export default function customer(props) {
  function CustomerProfile(props) {
    return (
      <div>
        <image src={props.img} alt="Proflie" />
        <h2>
          {props.name}({props.id})
        </h2>
      </div>
    );
  }

  return (
    <div>
      <CustomerProfile />
      <p>{props.birth}</p>
      <p>{props.gender}</p>
      <p>{props.job}</p>
    </div>
  );
}
